INSERT INTO `wp_car_rental_emails` (`email_id`, `email_type`, `email_subject`, `email_body`, `blog_id`) VALUES
(7,	1,	'Detalhes de reserva - n°. [BOOKING_CODE]',	'[IMG]https://aluguel.procarbrasil.com.br/wp-content/uploads/2019/02/591547590523-e1549989992386.png[/IMG]\n\nOlá, [CUSTOMER_NAME],\nPARABÉNS!!! SUA RESERVA FOI CONCLUÍDA COM SUCESSO!\n\nOs detalhes de sua reserva foram recebidos,\ne já estamos preparando o seu veículo para a data de retirada escolhida!!!\n\nDetalhes da reserva:\n\n[INVOICE]\n\n\n[S]Termos e Condições[/S]\n\n​​​​​​​​​​\nO carro é retirado com tanque cheio (gasolina, álcool ou diesel). Deverá ser devolvido da mesma maneira. O reabastecimento poderá ser, pela PROCAR RENT A CAR para sua comodidade e será cobrado com base em nossa tabela de preços.\n\nDesconto e promoções não são cumulativos. Em caso de duvida, visite nossa pagina de ofertas e veja os períodos e ofertas oferecidos.\n\n​​​Pré-autorização: Durante o período de locação, após a abertura de ​​contrato, será bloqueada a quantia referente ao grupo de carro escolhido. ​A liberação do limite dependerá do banco emissor e ocorrerá após a devolução do veículo.​\n\nA PROCAR RENT A CAR garante a reserva pelo período de até uma hora após o horário previsto para a retirada do carro reservado, limitada ao horário de fechamento da agência.\n\nA diária do carro é de 24 horas, com até 1 hora de tolerância para devolução.\n\nA partir da 25ª hora, incidirá cobrança de hora extra (1/5 do valor da diária para cada hora extra), sendo cobrada, inclusive, a hora de tolerância.\n\nA diária das coberturas de risco é de 24 horas, com 1 hora de tolerância. A partir da 25ª hora, incidirá cobrança de mais 1 diária dos seguros.\n\nPara as locações com período igual ou superior a 7 diárias, será exigido pagamento antecipado.\n\nCaso a reserva não seja cancelada com a antecedência mínima de doze horas do horário previsto para a retirada, poderá ser cobrada uma diária do carro reservado (no show). Na falta do modelo reservado, você poderá ser atendido com carros do mesmo grupo ou de um grupo superior.\n\nEm caso de roubo, furto, incêndio e colisão, será solicitado a apresentação obrigatória do Boletim de Ocorrência e o preenchimento do Aviso de Sinistro, na PROCAR RENT A CAR. ​​\n\nÁ retirada do veículo é permitida apenas para, no mínimo, 21 anos de idade, no mínimo, 2 anos de habilitação e ter cartão crédito em seu nome aprovado pela PROCAR RENT A CAR.\n\nO carro alugado pode ser devolvido em qualquer agência PROCAR RENT A CAR, será cobrado pelo retorno do carro entre agências.\nA cobrança poder ser:​\n\n- entre agências da mesma cidade;\n- ou por quilômetro de distância entre a cidade de destino e a cidade de origem, somando-se o valor de pedágio, caso haja (valores disponíveis nas agências PROCAR RENT A CAR).\n\nO veículo é entregue limpo dentro de padrões normais e razoáveis, e assim deverá ser devolvido. Caso seja devolvido com sujeira excessiva, será cobrada taxa de lavagem conforme tabela própria.\n\nOs valores de contratação de motorista e aluguel de adicionais não farão parte do valor total estimado da reserva, sendo seus valores somados no momento da devolução do veículo.Na contratação de motorista, caso haja despesas de pedágio e pernoite, o cliente arcará com as despesas.\n\n​Para alteração ou consulta, informe o número de confirmação de sua reserva em nosso site, clicando em https://aluguel.procarbrasil.com.br/minhas-reservas/\\\".​​\n​​\nAs cláusulas e condições do contrato de aluguel de carros estão à sua disposição nas agências PROCAR RENT A CAR​.\n​\nÉ UM PRAZER LHE TER COMO NOSSO CLIENTE PROCAR RENT A CAR!\n\n\n[IMG]https://aluguel.procarbrasil.com.br/wp-content/uploads/2019/02/591547590523-e1549989992386.png[/IMG]\n\nAtenciosamente,\n\n[S][COMPANY_NAME],\nTelefone de contato: [COMPANY_PHONE],\nEmail: [COMPANY_EMAIL][/S]\n',	1),
(8,	2,	'Pagamento concluído nº. [BOOKING_CODE]',	'[IMG]https://aluguel.procarbrasil.com.br/wp-content/uploads/2019/02/591547590523-e1549989992386.png[/IMG]\n\nOlá, [CUSTOMER_NAME],\n\nNós recebemos seu Pagamento! Sua reserva de numero [S] [BOOKING_CODE] [/S] está confirmada agora.\n\nDetalhes de sua reserva:\n\n[INVOICE]\n\n[IMG]https://aluguel.procarbrasil.com.br/wp-content/uploads/2019/02/591547590523-e1549989992386.png[/IMG]\nAtenciosamente,\n\n\n[S][COMPANY_NAME],\nTelefone de contato: [COMPANY_PHONE],\nEmail: [COMPANY_EMAIL][/S]',	1),
(9,	3,	'Reserva Cancelada nº. [BOOKING_CODE]',	'[IMG]https://aluguel.procarbrasil.com.br/wp-content/uploads/2019/02/591547590523-e1549989992386.png[/IMG]\n\nOlá, [CUSTOMER_NAME],\n\nSua solicitação de cancelamento de reserva n°. [BOOKING_CODE] foi atendida.\n\n[IMG]https://aluguel.procarbrasil.com.br/wp-content/uploads/2019/02/591547590523-e1549989992386.png[/IMG]\nAtenciosamente,\n\n\n[S][COMPANY_NAME],\nTelefone de contato: [COMPANY_PHONE],\nEmail: [COMPANY_EMAIL][/S]',	1),
(10,	4,	'Notificação: Nova reserva - [BOOKING_CODE]',	'[IMG]https://aluguel.procarbrasil.com.br/wp-content/uploads/2019/02/591547590523-e1549989992386.png[/IMG]\n\nNOVA RESERVA\n\nNova reserva n°. [BOOKING_CODE] recebida do cliente: [CUSTOMER_NAME].\n\nDetalhes da Reserva:\n[INVOICE]\n\n​​​​​​​​​​[S]TERMOS E CONDIÇÕES[/S]\nO carro é retirado com tanque cheio (gasolina, álcool ou diesel). Deverá ser devolvido da mesma maneira. O reabastecimento poderá ser, pela PROCAR RENT A CAR para sua comodidade e será cobrado com base em nossa tabela de preços.\n\nDesconto e promoções não são cumulativos. Em caso de duvida, visite nossa pagina de ofertas e veja os períodos e ofertas oferecidos.\n\n​​​Pré-autorização: Durante o período de locação, após a abertura de ​​contrato, será bloqueada a quantia referente ao grupo de carro escolhido. ​A liberação do limite dependerá do banco emissor e ocorrerá após a devolução do veículo.​\n\nA PROCAR RENT A CAR garante a reserva pelo período de até uma hora após o horário previsto para a retirada do carro reservado, limitada ao horário de fechamento da agência.\n\nA diária do carro é de 24 horas, com até 1 hora de tolerância para devolução.\n\nA partir da 25ª hora, incidirá cobrança de hora extra (1/5 do valor da diária para cada hora extra), sendo cobrada, inclusive, a hora de tolerância.\n\nA diária das coberturas de risco é de 24 horas, com 1 hora de tolerância. A partir da 25ª hora, incidirá cobrança de mais 1 diária dos seguros.\n\nPara as locações com período igual ou superior a 7 diárias, será exigido pagamento antecipado.\n\nCaso a reserva não seja cancelada com a antecedência mínima de doze horas do horário previsto para a retirada, poderá ser cobrada uma diária do carro reservado (no show). Na falta do modelo reservado, você poderá ser atendido com carros do mesmo grupo ou de um grupo superior.\n\nEm caso de roubo, furto, incêndio e colisão, será solicitado a apresentação obrigatória do Boletim de Ocorrência e o preenchimento do Aviso de Sinistro, na PROCAR RENT A CAR. ​​\n\nÁ retirada do veículo é permitida apenas para, no mínimo, 21 anos de idade, no mínimo, 2 anos de habilitação e ter cartão crédito em seu nome aprovado pela PROCAR RENT A CAR.\n\nO carro alugado pode ser devolvido em qualquer agência PROCAR RENT A CAR, será cobrado pelo retorno do carro entre agências. A cobrança poder ser:​\n\n- entre agências da mesma cidade;\n- ou por quilômetro de distância entre a cidade de destino e a cidade de origem, somando-se o valor de pedágio, caso haja (valores disponíveis nas agências PROCAR RENT A CAR).\n\nO veículo é entregue limpo dentro de padrões normais e razoáveis, e assim deverá ser devolvido. Caso seja devolvido com sujeira excessiva, será cobrada taxa de lavagem conforme tabela própria.\n\nOs valores de contratação de motorista e aluguel de adicionais não farão parte do valor total estimado da reserva, sendo seus valores somados no momento da devolução do veículo.Na contratação de motorista, caso haja despesas de pedágio e pernoite, o cliente arcará com as despesas.\n\n​Para alteração ou consulta, informe o número de confirmação de sua reserva em nosso site, clicando em https://aluguel.procarbrasil.com.br/minhas-reservas/.​​\n​​\nAs cláusulas e condições do contrato de aluguel de carros estão à sua disposição nas agências PROCAR RENT A CAR​.\n​\n\n\n\n[IMG]https://aluguel.procarbrasil.com.br/wp-content/uploads/2019/02/591547590523-e1549989992386.png[/IMG]\n\nAtenciosamente,\n\n[S][COMPANY_NAME],\nTelefone de contato: [COMPANY_PHONE],\nEmail: [COMPANY_EMAIL][/S]',	1),
(11,	5,	'Notificação: Reserva paga - [BOOKING_CODE]',	'[IMG]https://aluguel.procarbrasil.com.br/wp-content/uploads/2019/02/591547590523-e1549989992386.png[/IMG]\n\nAviso de reserva paga:\n\nReserva nº. [BOOKING_CODE] foi recentemente paga por [CUSTOMER_NAME].\n\nDetalhes de reserva:\n[INVOICE]\n\n[IMG]https://aluguel.procarbrasil.com.br/wp-content/uploads/2019/02/591547590523-e1549989992386.png[/IMG]\n\nAtenciosamente,\n\n\n[S][COMPANY_NAME],\nTelefone de contato: [COMPANY_PHONE],\nEmail: [COMPANY_EMAIL][/S]',	1),
(12,	6,	'Notificação interna de Cancelamento de reserva - [BOOKING_CODE]',	'[IMG]https://aluguel.procarbrasil.com.br/wp-content/uploads/2019/02/591547590523-e1549989992386.png[/IMG]\n\nReserva nº. [BOOKING_CODE] para [CUSTOMER_NAME] foi recentemente cancelada.\n\nDetalhes da reserva que foi cancelada:\n[INVOICE]\n\n[IMG]https://aluguel.procarbrasil.com.br/wp-content/uploads/2019/02/591547590523-e1549989992386.png[/IMG]\n\nAtenciosamente,\n\n[S][COMPANY_NAME],\nTelefone de contato: [COMPANY_PHONE],\nEmail: [COMPANY_EMAIL][/S]',	1);
