(2,	1,	'2019-02-11 13:17:40',	'2019-02-11 13:17:40',	'<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Olá! Eu sou um mensageiro de bicicleta durante o dia, ator aspirante à noite, e este é o meu site. Eu moro em São Paulo, tenho um grande cachorro chamado Rex e gosto de tomar caipirinha (e banhos de chuva).</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...ou alguma coisa assim:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p></p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>Como um novo usuário do WordPress, você deveria ir ao <a href=\"http://aluguel.procarbrasil.com.br/wp-admin/\">painel</a> para excluir essa página e criar novas páginas para o seu conteúdo. Divirta-se!</p>\n<!-- /wp:paragraph -->',	'Página de exemplo',	'',	'publish',	'closed',	'open',	'',	'',	'',	'',	'2019-02-11 13:17:40',	'2019-02-11 13:17:40',	'',	0,	'https://aluguel.procarbrasil.com.br/?page_id=2',	0,	'page',	'',	0),
(3,	1,	'2019-02-11 13:17:40',	'2019-02-11 13:17:40',	'<!-- wp:heading -->\r\n<ol>\r\n<li><strong>INTRODUÇÃO</strong></li>\r\n</ol>\r\n<p>A Empresa PROCAR RENT A CAR S/A está comprometida com a proteção da privacidade pessoal seguindo todas as premissas das leis em vigência por meio da presente Política de Privacidade, a qual abrange todo nosso tratamento e manejo com relação a todas e quaisquer informações pessoais que coletamos, usamos e divulgamos, sejam elas atinentes a Motoristas, Usuários ou Parceiros.</p>\r\n<p>Podemos atualizar esta Política de Privacidade de tempos em tempos de acordo com os critérios que julguemos necessários para garantir a segurança das informações obtidas. A versão mais atual será sempre disponibilizada em nosso site e no aplicativo App PROCAR.</p>\r\n<p>Ao utilizar nossas plataformas, rentacar.procarbrasil.com.br ou nosso aplicativo, nos viabilizando qualquer informação pessoal, você estará concordando com a coleta, uso e divulgação de suas informações pessoais, conforme estabelecido nesta Política de Privacidade.</p>\r\n<p>&nbsp;</p>\r\n<ol start=\"2\">\r\n<li><strong>TIPOS DE INFORMAÇÕES COLETADAS</strong></li>\r\n</ol>\r\n<p>Os tipos de informações pessoais que coletamos e retemos vai variar de acordo com a sua continuidade na utilização dos serviços prestados. Essas informações podem ser incluídas em qualquer um dos itens a seguir: Nome, Endereço, Telefone, Endereço Eletrônico, Informações de Pagamento, incluindo tipo de cartão de crédito e data de validade (essas informações são armazenadas pelo processador de pagamentos de terceiros), Número da carteira de motorista, outras informações pessoais necessárias para fornecer nossos serviços, incluindo idade e status de residência e detalhes da transação relacionados ao uso de nossos produtos, serviços ou benefícios.</p>\r\n<p>Não serão coletadas informações confidenciais de você ou de terceiros, exceto para realização de eventuais entregas por solicitação de quem de fato utiliza nossos serviços. Quando fornecidas informações pessoais de terceiros, é sua responsabilidade garantir que essas pessoas estejam cientes desta Política de Privacidade, compreendê-la e concordar em aceitá-la. Não será necessário o fornecimento de nenhuma informação pessoal, no entanto, se você não fizer isso, talvez não possamos fornecer os produtos, serviços ou benefícios que você solicitou.</p>\r\n<p>Também são coletados os seguintes itens quando nosso site ou aplicativo são acessados:</p>\r\n<ol>\r\n<li>Informações anônimas não pessoais sobre como você usa nosso site;</li>\r\n<li>\"Cookie\" com base em informações que facilitam o uso do nosso site, registrando suas preferências para que, quando você retornar ao nosso site, o \"cookie\" recarregue essas informações em seu navegador da web.</li>\r\n</ol>\r\n<p><strong> </strong></p>\r\n<ol start=\"3\">\r\n<li><strong>COMO COLETAMOS INFORMAÇÕES PESSOAIS</strong></li>\r\n</ol>\r\n<p>A coleta de informações se dá das seguintes maneiras:</p>\r\n<ol>\r\n<li>Com o envio de informações através de nossos sites ou de um de nossos aplicativos;</li>\r\n<li>Por meio de ligações, envio de e-mail ou comunicação via Chat Online para falar com um de nossos agentes de atendimento ao cliente;</li>\r\n<li>Em interações através de uma plataforma de mídia social;</li>\r\n</ol>\r\n<p><strong> </strong></p>\r\n<ul>\r\n<li><strong>TAMBÉM COLETAMOS INFORMAÇÕES PESSOAIS POR MEIO DE:</strong></li>\r\n</ul>\r\n<p><strong> </strong></p>\r\n<ol>\r\n<li>Nosso corpo corporativo relacionado;</li>\r\n<li>Nossos parceiros de negócios;</li>\r\n<li>Terceiros que nos prestam serviços.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p>Usaremos as informações pessoais que coletamos para o propósito divulgado no momento da coleta, ou conforme estabelecido nesta Política de Privacidade. Não usaremos suas informações pessoais para qualquer outra finalidade sem antes solicitar seu consentimento ou quando autorizado ou exigido por lei.</p>\r\n<p><strong> </strong></p>\r\n<ol start=\"4\">\r\n<li><strong>O PORQUE NÓS FAZEMOS ISSO:</strong></li>\r\n</ol>\r\n<p><strong> </strong></p>\r\n<ol>\r\n<li>Estabelecer e manter seu relacionamento conosco;</li>\r\n<li>para fornecer os produtos ou serviços que você solicitou de nós; ou</li>\r\n<li>para responder a qualquer pergunta que você faça.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p>Nós divulgaremos informações pessoais, conforme exigido pelos provedores dos produtos e serviços que você reservou ou comprou (como locadoras de carros e seguradoras). Você aceita que nem todos os destinatários de suas informações podem ter políticas de privacidade ou estar sujeitos a leis de privacidade equivalentes a nós e consentir com a divulgação de suas informações pessoais para essa finalidade.</p>\r\n<p>Também podemos divulgar suas informações pessoais a terceiros que trabalhem conosco em nossos negócios para fornecer, promover ou melhorar os produtos ou serviços que você solicitou ou está interessado, como:</p>\r\n<ol>\r\n<li>consultores de marketing e empresas de promoções; anfitriões do site;</li>\r\n<li>consultores e consultores profissionais</li>\r\n<li>sua empresa ou organização, se você usar nossos serviços em uma conta corporativa;</li>\r\n<li>um de nossos parceiros do programa se você for um membro de seu programa de viajante frequente e tiver solicitado que enviemos detalhes de seu contrato de locação conosco;</li>\r\n<li>nossos prestadores de serviços contratados (incluindo nosso gateway de pagamento, empresa de pesquisa de mercado e nossa casa de correspondência);</li>\r\n<li>provedores de cartão de crédito e débito;</li>\r\n<li>bancos;</li>\r\n<li>relatórios de crédito e agências de verificação de fraudes;</li>\r\n<li>agências de cobrança de dívidas, se você inadimplir no pagamento de fundos devidos a nós;</li>\r\n<li>conselhos, organizações governamentais e privadas responsáveis ​​pelo processamento ou tratamento de infracções relacionadas com o tráfego ou o pagamento de portagens rodoviárias e de trânsito;</li>\r\n<li>em relação a um acidente ou sinistro, seguradoras, a polícia e outras pessoas envolvidas no acidente;</li>\r\n<li>agências governamentais, reguladoras e policiais, onde a divulgação é exigida ou autorizada por lei;</li>\r\n<li>Marketing direto</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"5\">\r\n<li><strong>COMO NÓS ARMAZENAMOS E PROTEGEMOS INFORMAÇÕES PESSOAIS</strong></li>\r\n</ol>\r\n<p>Armazenamos informações pessoais em uma combinação de instalações de armazenamento de computadores, arquivos em papel e outros registros. Ao fazer isso, tomamos várias medidas para proteger suas informações pessoais contra uso indevido, interferência e perda, além de acesso, modificação ou divulgação não autorizados.</p>\r\n<p>Além disso, tomamos medidas razoáveis ​​para destruir ou permanentemente desindentificar as informações pessoais quando não precisarmos mais delas.</p>\r\n<p>A internet não é um método seguro de transmissão de informações. Da mesma forma, exceto quando usamos a tecnologia SSL (Secure Socket Layer) para garantir que as informações sejam transmitidas e processadas com segurança, não podemos e não aceitamos a responsabilidade pela segurança das informações que você envia ou recebe de nós pela Internet ou por qualquer acesso não autorizado. acesso ou uso dessa informação.</p>\r\n<p>&nbsp;</p>\r\n<ol start=\"6\">\r\n<li><strong>COMO VOCÊ PODE ACESSAR SUAS INFORMAÇÕES PESSOAIS</strong></li>\r\n</ol>\r\n<p>Tomaremos medidas razoáveis ​​para garantir que as informações pessoais que coletamos, utilizamos ou divulgamos sejam precisas, completas e atualizadas. Se os seus dados pessoais mudarem, como seu endereço ou número de telefone, entre em contato com o nosso Diretor de Privacidade por e-mail ou no endereço detalhado abaixo.</p>\r\n<p>A seu pedido, forneceremos a você uma cópia de qualquer informação pessoal que tenhamos sobre você. Podemos cobrar uma taxa pela recuperação dessas informações. Nesse caso, informaremos você sobre a taxa e obteremos sua concordância com essa taxa antes de fornecer as informações.</p>\r\n<p>Reconheceremos e investigaremos imediatamente qualquer reclamação sobre a maneira como gerenciamos as informações pessoais</p>\r\n<ul>\r\n<li><strong>COOKIES</strong></li>\r\n</ul>\r\n<p>Nosso site usa cookies para realizar publicidade direcionada na internet, rastrear padrões de tráfego de usuários e para atendê-lo melhor quando você revisita um site. Um cookie é um pequeno arquivo de dados que um site pode gravar em seu disco rígido quando você o visita. Um arquivo de cookie pode conter informações, como um ID de</p>\r\n<p>usuário que o site usa para rastrear as páginas que você visitou. Você pode recusar todos os cookies, desativando-os no seu navegador. No entanto, a funcionalidade completa dos nossos sites requer o uso de cookies.</p>\r\n<p>Informações também são geradas sempre que uma página é acessada em nosso site que registra informações como a hora, a data e a página específica.  Coletamos essas informações para fins estatísticos e de manutenção, o que nos permite avaliar continuamente o desempenho do nosso site.</p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li><strong>VIOLAÇÕES DE DADOS</strong></li>\r\n</ul>\r\n<p>Levamos as violações de dados a sério e agimos em conformidade com o esquema de Violações de Dados Notificáveis ​​estabelecido pela Lei de Alteração de Privacidade (??).</p>\r\n<p>Usaremos nossos melhores esforços para conter, avaliar e corrigir violações de dados reais e suspeitas o quanto antes e no máximo em 30 dias corridos após a data da violação de dados real ou suspeita, de acordo com nossas políticas e procedimentos de resposta à violação de dados da empresa.</p>\r\n<p>Quando suas informações pessoais mantidas por nós forem perdidas ou sujeitas a acesso não autorizado, modificação, uso ou divulgação ou outro uso indevido, e isso é provável que resulte em sérios danos a você ou a outras pessoas, tomaremos medidas para remediar o risco de sérios danos o mais rápido possível. Se não tivermos sido capazes de evitar o provável risco de danos sérios com medidas corretivas, notificaremos você, outras pessoas afetadas e o orgão superior.</p>\r\n<p>&nbsp;</p>\r\n<ol start=\"7\">\r\n<li><strong>COMO ENTRAR EM CONTATO CONOSCO OU FAZER UMA RECLAMAÇÃO</strong></li>\r\n</ol>\r\n<p>Se você tiver alguma dúvida sobre esta Política de Privacidade, se desejar atualizar as informações que mantemos sobre você ou se desejar fazer uma reclamação sobre nossa coleta, uso ou divulgação de suas informações pessoais sob esta Política de Privacidade, entre em contato:</p>\r\n<p>Rua Embú,68 sala22 - Alphaville Campinas, SP - CEP 13098-325</p>\r\n<p>E-mail: contato@procarbrasil.com.br</p>\r\n<p>Tomaremos medidas razoáveis ​​para solucionar quaisquer problemas resultantes de nossa falha em cumprir nossas obrigações de privacidade.</p>\r\n<p>Se você não estiver satisfeito com o resultado da sua reclamação, pode encaminhar a questão para contato@procarbrasil.com.br.</p>\r\n<!-- /wp:heading -->',	'Política de privacidade',	'',	'publish',	'closed',	'open',	'',	'politica-de-privacidade-2',	'',	'',	'2019-03-13 09:06:24',	'2019-03-13 12:06:24',	'',	0,	'https://aluguel.procarbrasil.com.br/?page_id=3',	0,	'page',	'',	0),
