(43,	1,	'2015-03-10 07:49:22',	'2015-10-27 21:18:30',	'<strong>PREÇO</strong>\r\nO preço inclui: seguro civil, seguro KASKO, assistência rodoviária de emergência 24/7, imposto sobre vendas.\r\n\r\n<strong>PERÍODO</strong>\r\nMínimo período de locação de 1 dia.\r\n\r\n<strong>RESPONSABILIDADE DO ALUGADOR</strong>\r\nO locatário é obrigado a fornecer um veículo ao locatário por um preço especificado.\r\nO locatário se torna o legítimo proprietário de um carro durante o período de aluguel. O locatário assegura o carro e o locatário. O locatário é obrigado a verificar o estado do veículo e garantir que ele seja seguro antes do aluguel. O carro que o locatário fornece deve estar limpo e abastecido.\r\n\r\n<strong>LIMITAÇÕES</strong>\r\nO locatário deve ter pelo menos um ano de experiência de condução,\r\nusar o carro apenas no território Brasileiro (a menos que o locatário especifique diferentemente). A quilometragem do carro alugado é ilimitada.\r\n\r\n<strong>RESPONSABILIDADE DO LOCATÁRIO</strong>\r\nO locatário deve fornecer uma carteira de motorista válida, o que lhe permite dirigir o carro alugado. O locatário também deve apresentar um passaporte ou carteira de identidade. O locatário deve pagar o preço integral pelo aluguel antes do início do aluguel.\r\nO locatário deve deixar um depósito para o carro que varia de 100 a 400 Reais dependendo da classe do carro. Isso pode ser usado para cobrir quaisquer danos causados ​​ao carro, que podem ocorrer durante o período de aluguel do carro. Ao devolver o carro, o locatário também deve pagar pelo combustível consumido no tanque de combustível, já que o locatário sempre fornece um carro com o tanque de combustível cheio.\r\n\r\n<strong>RESPONSABILIDADE</strong>\r\n\r\nO locatário assume total responsabilidade se um evento não segurável ocorrer durante o período de aluguel. O locatário assume a responsabilidade por todas as consequências que podem ocorrer ao transferir o carro para uma terceira pessoa. Se o locatário violar as regras de trânsito, deverá pagar todas as penalidades relacionadas.\r\nEm caso de roubo de carro, o locatário deve compensar o dano se não devolver as chaves do carro e os documentos de registro ao lugar de retorno.',	'Termos e condições do aluguel de automóveis',	'',	'publish',	'closed',	'closed',	'',	'termo-e-condicoes-do-aluguel-de-automoveis',	'',	'',	'2019-02-25 15:35:15',	'2019-02-25 18:35:15',	'',	0,	'http://nativerental.com/cars/?post_type=car_rental_page&#038;p=43',	0,	'car_rental_page',	'',	0),
