(3034,	1,	'2019-02-20 08:06:18',	'2019-02-20 10:06:18',	'PREÇO\nO preço inclui: seguro civil, seguro KASKO, assistência rodoviária de emergência 24/7, imposto sobre vendas.\n\nPERÍODO\nMínimo período de locação de 1 dia.\n\nRESPONSABILIDADE DO ALUGADOR\nO locatário é obrigado a fornecer um veículo ao locatário por um preço especificado.\nO locatário se torna o legítimo proprietário de um carro durante o período de aluguel. O locatário assegura o carro e o locatário. O locatário é obrigado a verificar o estado do veículo e garantir que ele seja seguro antes do aluguel. O carro que o locatário fornece deve estar limpo e abastecido.\n\nLIMITAÇÕES\nO locatário deve ter pelo menos um ano de experiência de condução,\nusar o carro apenas no território da Lituânia (a menos que o locatário especifique diferentemente). A quilometragem do carro alugado é ilimitada.\n\nRESPONSABILIDADE DO LOCATÁRIO\nO locatário deve fornecer uma carteira de motorista válida, o que lhe permite dirigir o carro alugado. O locatário também deve apresentar um passaporte ou carteira de identidade ao locatário. O locatário deve pagar o preço integral pelo aluguel antes do início do aluguel.\nO locatário deve deixar um depósito para o carro que varia de 100 a 400 USD dependendo da classe do carro. Isso pode ser usado para cobrir quaisquer danos causados ​​ao carro, que podem ocorrer durante o período de aluguel do carro. Ao devolver o carro, o locatário também deve pagar pelo combustível consumido no tanque de combustível, já que o locatário sempre fornece um carro com o tanque de combustível cheio.\n\nRESPONSABILIDADE\n\nO locatário assume total responsabilidade se um evento não segurável ocorrer durante o período de aluguel. O locatário assume a responsabilidade por todas as consequências que podem ocorrer ao transferir o carro para uma terceira pessoa. Se o locatário violar as regras de trânsito, deverá pagar todas as penalidades relacionadas.\nEm caso de roubo de carro, o locatário deve compensar o dano se não devolver as chaves do carro e os documentos de registro ao locatário.',	'Termos e condições do aluguel de automóveis',	'',	'inherit',	'closed',	'closed',	'',	'43-autosave-v1',	'',	'',	'2019-02-20 08:06:18',	'2019-02-20 10:06:18',	'',	43,	'https://aluguel.procarbrasil.com.br/sem-categoria/43-autosave-v1/',	0,	'revision',	'',	0),
