(3026,	2,	'2019-02-19 18:55:27',	'2019-02-19 20:55:27',	'<h2>QUEM NÓS SOMOS</h2>\r\nNosso endereço de internet é: http://aluguel.procarbrasil.com.br\r\n<h2>Quais dados pessoais coletamos, e por que o coletamos</h2>\r\n<h3>Comentários</h3>\r\nQuando visitantes deixam comentários no site, coletamos os dados mostrados no <span lang=\"pt\" tabindex=\"0\">formulário de comentários e também o endereço IP do visitante e a string do agente do usuário do navegador para ajudar na detecção de spam.</span>\r\n\r\n<span lang=\"pt\" tabindex=\"0\">Uma string anonimizada criada a partir do seu endereço de e-mail (também chamado de hash) pode ser fornecida ao serviço Gravatar para ver se você está usando. A política de privacidade do serviço Gravatar está disponível aqui: https://automattic.com/privacy/. Após a aprovação do seu comentário, a foto do seu perfil ficará visível para o público no contexto do seu comentário.</span>\r\n<h3>Meios de comunicação</h3>\r\nSe você fizer upload de imagens para o site, evite o upload de imagens com dados de localização incorporados (GPS EXIF) incluídos. Os visitantes do site podem baixar e extrair quaisquer dados de localização de imagens no site.\r\n<h3>Formulário de contato</h3>\r\n<h3>Cookies</h3>\r\n<span lang=\"pt\" tabindex=\"0\">Se você deixar um comentário em nosso site, você pode optar por salvar seu nome, endereço de e-mail e site em cookies. Estes são para sua conveniência, para que você não precise preencher seus dados novamente quando deixar outro comentário. Esses cookies durarão um ano.</span>\r\n\r\n<span lang=\"pt\" tabindex=\"0\">Se você tiver uma conta e fizer login neste site, definiremos um cookie temporário para determinar se seu navegador aceita cookies. Este cookie não contém dados pessoais e é descartado quando você fecha o navegador.</span>\r\n\r\n<span lang=\"pt\" tabindex=\"0\">Quando você fizer login, também configuraremos vários cookies para salvar suas informações de login e suas opções de exibição na tela. Os cookies de login duram dois dias e os cookies de opções de tela duram um ano. Se você selecionar \"Lembrar de Mim\", seu login persistirá por duas semanas. Se você sair da sua conta, os cookies de login serão removidos.</span>\r\n\r\n<span lang=\"pt\" tabindex=\"0\">Se você editar ou publicar um artigo, um cookie adicional será salvo no seu navegador. Este cookie não inclui dados pessoais e simplesmente indica o ID do post que você acabou de editar. Expira após 1 dia.</span>\r\n<h3><span lang=\"pt\" tabindex=\"0\">Conteúdo incorporado de outros sites</span></h3>\r\n<span lang=\"pt\" tabindex=\"0\">Os artigos deste site podem incluir conteúdo incorporado (por exemplo, vídeos, imagens, artigos etc.). O conteúdo incorporado de outros sites se comporta da mesma maneira como se o visitante tivesse visitado o outro site. </span>\r\n\r\n<span lang=\"pt\" tabindex=\"0\">Esses sites podem coletar dados sobre você, usar cookies, incorporar rastreamento adicional de terceiros e monitorar sua interação com o conteúdo incorporado, incluindo rastrear sua interação com o conteúdo incorporado se você tiver uma conta e estiver conectado a esse site.</span>\r\n<h3>A<span lang=\"pt\" tabindex=\"0\">nalítica</span></h3>\r\n<h2><span lang=\"pt\" tabindex=\"0\">Com quem compartilhamos seus dados </span></h2>\r\n<h2><span lang=\"pt\" tabindex=\"0\">Por quanto tempo retemos seus dados</span></h2>\r\n<span lang=\"pt\" tabindex=\"0\">Se você deixar um comentário, o comentário e seus metadados serão retidos indefinidamente. Isso é para que possamos reconhecer e aprovar quaisquer comentários de acompanhamento automaticamente, em vez de mantê-los em uma fila de moderação. </span>\r\n\r\n<span lang=\"pt\" tabindex=\"0\">Para usuários que se registram em nosso site (se houver), também armazenamos as informações pessoais que eles fornecem em seu perfil de usuário. Todos os usuários podem ver, editar ou excluir suas informações pessoais a qualquer momento (exceto que não podem alterar seu nome de usuário). Administradores de sites também podem ver e editar essas informações.</span>\r\n\r\n.\r\n<h2><span lang=\"pt\" tabindex=\"0\">Quais direitos você tem sobre seus dados</span></h2>\r\n<span lang=\"pt\" tabindex=\"0\">Se você tiver uma conta neste site ou tiver deixado comentários, poderá solicitar o recebimento de um arquivo exportado dos dados pessoais que mantemos sobre você, incluindo quaisquer dados que você nos forneceu. Você também pode solicitar que apague quaisquer dados pessoais que tenhamos sobre você. Isso não inclui quaisquer dados que somos obrigados a manter para fins administrativos, legais ou de segurança.</span>\r\n<h2>Onde nós enviamos seus dados</h2>\r\n<span lang=\"pt\" tabindex=\"0\">Os comentários dos visitantes podem ser verificados através de um serviço automatizado de detecção de spam.</span>\r\n<h2><span lang=\"pt\" tabindex=\"0\">Sua informação de contato </span></h2>\r\n<h2><span lang=\"pt\" tabindex=\"0\">Informação adicional</span></h2>\r\n<h3><span lang=\"pt\" tabindex=\"0\">Como protegemos seus dados </span></h3>\r\n<h3><span lang=\"pt\" tabindex=\"0\">Quais procedimentos de violação de dados temos em vigor </span></h3>\r\n<h3><span lang=\"pt\" tabindex=\"0\">De que terceiros nós recebemos dados de </span></h3>\r\n<h3><span lang=\"pt\" tabindex=\"0\">O que a tomada de decisão automatizada e / ou perfilamento fazemos com os dados do usuário </span></h3>\r\n<h3><span lang=\"pt\" tabindex=\"0\">Requisitos de divulgação regulamentar da indústria</span></h3>',	'Politica de privacidade',	'',	'inherit',	'closed',	'closed',	'',	'2957-revision-v1',	'',	'',	'2019-02-19 18:55:27',	'2019-02-19 20:55:27',	'',	2957,	'https://aluguel.procarbrasil.com.br/sem-categoria/2957-revision-v1/',	0,	'revision',	'',	0),
