(3042,	1,	'2019-02-20 09:23:55',	'2019-02-20 11:23:55',	'[vc_row][vc_column width=\"1/6\"][/vc_column][vc_column width=\"2/3\"][vc_title tag=\"h2\" line_color=\"secondary_color_background\" text=\"General Questions\"][vc_column_text]\n<p style=\"text-align: center\">You’ll find in this section all the frequently asked question.\nIf you need futher informations, feel free to <a href=\"https://wpcarrental.com/modern/contact/\">Contact us</a>.</p>\n[/vc_column_text][vc_toggle title=\"Are the vehicles insured?\" style=\"arrow\" color=\"secondary_color\" size=\"lg\" el_id=\"1503108365184-6651c676-ed6b\"]Yes, all our vehicles have mandatory Civil and CASCO insurances.[/vc_toggle][vc_toggle title=\"What are the methods of payment for the car rental services?\" style=\"arrow\" color=\"secondary_color\" el_id=\"1503108436210-880cdb63-6785\"]You can pay by cash, Paypal or by bank transfer.[/vc_toggle][vc_toggle title=\"How do I rent a car?\" style=\"arrow\" color=\"secondary_color\" el_id=\"1503108588928-b0e0c6e4-4e6a\"]You can rent a car by simply clicking on the home button in the menu or by calling +1 450 610 0990. If you choose to reserve a car online, we will contact you to confirm your reservation.[/vc_toggle][vc_toggle title=\"Can I change the car after the reservation?\" style=\"arrow\" color=\"secondary_color\" el_id=\"1503108650445-c76d15ae-321e\"]Yes. If you would like to change or cancel your reservation of a car after approving it, please call +1 450 610 0990 or reach us by contacts provided in the Contacts page.[/vc_toggle][vc_toggle title=\"Where can I take the car from and where should I return it?\" style=\"arrow\" color=\"secondary_color\"]You can take the car at the address 625 2nd Street, San Francisco. If you have reserved a car for more than three days, we can deliver the car to the location of your choice. The car has to be returned to an agreed location in San Francisco.[/vc_toggle][vc_toggle title=\"What should I do, if the car breaks down?\" style=\"arrow\" color=\"secondary_color\"]If your car breaks down, please call us immediately at +1 450 600 4000[/vc_toggle][vc_toggle title=\"Do you deliver cars outside San Francisco?\" style=\"arrow\" color=\"secondary_color\"]Yes, we will deliver you the car to the location of your choice for an additional price.[/vc_toggle][vc_toggle title=\"When can I contact you?\" style=\"arrow\" color=\"secondary_color\"]You can call us 24/7 by phone no. +1 450 600 4000[/vc_toggle][vc_toggle title=\"Are there any maps in the car?\" style=\"arrow\" color=\"secondary_color\"]Yes, if you wish, we will provide maps of San Francisco and United States for free.[/vc_toggle][vc_empty_space][/vc_column][vc_column width=\"1/6\"][/vc_column][/vc_row]',	'FAQ',	'',	'inherit',	'closed',	'closed',	'',	'563-revision-v1',	'',	'',	'2019-02-20 09:23:55',	'2019-02-20 11:23:55',	'',	563,	'https://aluguel.procarbrasil.com.br/sem-categoria/563-revision-v1/',	0,	'revision',	'',	0),
